import React from "react";

import CustomButton from "../custom-button/custom-button.jsx";
import "./cart-dropdown.scss";

const cart = () => (
  <div className="cart-dropdown">
    <div className="cart-items"></div>
    <CustomButton>Go TO CHECKOUT</CustomButton>
  </div>
);

export default cart;
